  [],\n\t\"revision_timestamp\": \"2015-09-27T00:00:52.352486\",\n\t\"name\": \"globec-nep-mocness-plankton-moc1-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"GLOBEC (GLOBal Ocean ECosystems Dynamics)
  NEP (Northeast Pacific) California Current ProgramnMOCNESS Plankton (MOC1) DatanThe
  MOCNESS is based on the Tucker Trawl principle (Tucker, 1951). The MOCNESS-1 has
  nine rectangular nets (1m x 1.4 m) which are opened and closed sequentially by commands
  through conducting cable from the surface (Wiebe et al., 1976). In MOCNESS systems,
  \"the underwater unit sends a data frame, comprised of temperature, depth, conductivity,
  net-frame angle, flow count, time, number of open net, and net opening/closing,
  to the deck unit in a compressed hexadecimal format every 2 seconds and from the
  deck unit to a microcomputer every 4 seconds... Temperature (to approximately 0.01
  deg C) and conductivity are measured with SEABIRD sensors. Normally, a modified
  T.S.K.-flowmeter is used... Both the temperature and conductivity sensors and the
  flowmeter are mounted on top of the frame so that they face horizontally when the
  frame is at a towing angle of 45deg... Calculations of salinity (to approximately
  0.01 o/oo S), potential temperature (theta), potential density (sigma), the oblique
  and vertical velocities of the net, and the approximate volume filtered by each
  net are made after each string of data has been received by the computer.\" (Wiebe
  et al., 1985) In addition, depending on the particular configuration of the MOCNESS-1,
  data may have been collected from other sensors attached to the frame : (Transmissometer,
  Fluorometer, Downwelling light sensor, and the Oxygen sensor). A SeaBird underwater
  pump was also included in the sensor suit e.nAfter retrieval to deck, the contents
  of the nets were rinsed into the codends a nd transferred to storage bottles, and
  fixed and preserved with formalin. In the shore laboratory, the contents of the
  bottles were subsampled and counts and biomass estimates made for selected taxa
  (see the Proc_Protocol info below). This data object reports only the count information.nnFor
  more information, seenhttp://cis.whoi.edu/science/bcodmo/dataset.cfm?id=10182&flag=viewnornhttp://globec.whoi.edu/jg/info/globec/nep/ccs/MOC1%7Bdir=globec.whoi.edu/jg/dir/globec/nep/ccs/,data=globec.coas.oregonstate.edu/jg/serv/MOC1.html0%7DnnAll
  inquiries about this data should be directed to Dr. William Peterson (bill.peterson@noaa.gov).nInquiries
  about how to access this data should be directed to Dr. Hal Batchelder (hbatchelder@coas.oregonstate.edu).\",\n\t\"license_title\":
